  [buffer]
  (-> buffer
    (cvt-color! COLOR_RGB2GRAY)
    (bilateral-filter! 10 250 30)
    (median-blur! 7)
    (adaptive-threshold! 255 ADAPTIVE_THRESH_MEAN_C THRESH_BINARY 9 3)
    (cvt-color! COLOR_GRAY2BGR)))
